import React, { useState, useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import { motion } from 'framer-motion';
import { Search, Moon, Sun } from 'lucide-react';

const TrackOrderPage = ({ getOrderStatus }) => {
  const [orderId, setOrderId] = useState('');
  const [orderStatus, setOrderStatus] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [isDarkMode, setIsDarkMode] = useState(false);
  const location = useLocation();

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const orderIdParam = params.get('orderId');
    if (orderIdParam) {
      setOrderId(orderIdParam);
      handleTrackOrder(orderIdParam);
    }
  }, [location]);

  const handleTrackOrder = async (id = orderId) => {
    setLoading(true);
    setError(null);
    try {
      const status = await getOrderStatus(id);
      if (status === 'Not Found') {
        setError('Order not found. Please check the order ID and try again.');
      } else {
        setOrderStatus(status);
      }
    } catch (error) {
      console.error('Error fetching order status:', error);
      setError('Failed to fetch order status. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const toggleTheme = () => {
    setIsDarkMode(!isDarkMode);
  };

  const themeClass = isDarkMode ? 'bg-gray-900 text-white' : 'bg-gray-100 text-gray-900';

  return (
    <div className={`min-h-screen p-8 transition-colors duration-300 ${themeClass}`}>
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.5 }}
        className="max-w-3xl mx-auto"
      >
        <div className="flex justify-between items-center mb-12">
          <h1 className="text-5xl font-bold text-green-600">
            Track Your Order
          </h1>
          <button
            onClick={toggleTheme}
            className="p-2 rounded-full bg-green-500 text-white hover:bg-green-600 transition-colors duration-300"
          >
            {isDarkMode ? <Sun size={24} /> : <Moon size={24} />}
          </button>
        </div>
        <div className={`p-8 rounded-lg shadow-lg mb-8 ${isDarkMode ? 'bg-gray-800' : 'bg-white'}`}>
          <form onSubmit={(e) => { e.preventDefault(); handleTrackOrder(); }} className="space-y-6">
            <div className="relative">
              <input
                type="text"
                value={orderId}
                onChange={(e) => setOrderId(e.target.value)}
                placeholder="Enter your order ID"
                className={`w-full px-6 py-4 border-2 rounded-full focus:outline-none focus:border-green-500 text-lg ${
                  isDarkMode ? 'bg-gray-700 text-white border-gray-600' : 'bg-gray-100 text-gray-900 border-gray-300'
                }`}
                required
              />
              <Search className="absolute right-6 top-1/2 transform -translate-y-1/2 text-gray-400" size={24} />
            </div>
            <motion.button
              type="submit"
              className="w-full bg-green-500 text-white font-bold py-4 px-6 rounded-full hover:bg-green-600 transition-all duration-300"
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              disabled={loading}
            >
              {loading ? 'Tracking...' : 'Track Order'}
            </motion.button>
          </form>
        </div>
        
        {error && (
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            className="bg-red-500 text-white p-4 rounded-lg mb-8"
          >
            {error}
          </motion.div>
        )}

        {orderStatus && (
          <motion.div
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.5 }}
            className={`p-8 rounded-lg shadow-lg ${isDarkMode ? 'bg-gray-800' : 'bg-white'}`}
          >
            <h2 className="text-3xl font-semibold mb-6 text-green-600">Order Status</h2>
            <p className="text-lg">{orderStatus}</p>
          </motion.div>
        )}
      </motion.div>
    </div>
  );
};

export default TrackOrderPage;
